pragma solidity ^0.8.19;

import { IERC20 } from "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import { IERC721 } from "@openzeppelin/contracts/token/ERC721/IERC721.sol";

enum OfferKind { LOAN, MARKET }
enum Criteria { SIMPLE, PROOF }
enum Side { BID, ASK }

struct Lien {
    address borrower;
    IERC721 collection;
    uint256 tokenId;
    IERC20 currency;
    uint256 principal;
    uint256 rate;
    uint256 defaultRate;
    uint256 duration;
    uint256 gracePeriod;
    address recipient;
    uint256 fee;
    uint256 startTime;
}

struct Collateral {
    Criteria criteria;
    IERC721 collection;
    uint256 identifier;
}

struct FeeTerms {
    address recipient;
    uint256 rate;
}

// ====================================
//            LOAN OFFER
// ====================================

struct LoanOfferTerms {
    IERC20 currency;
    uint256 amount;
    uint256 maxAmount;
    uint256 minAmount;
    uint256 rate;
    uint256 defaultRate;
    uint256 duration;
    uint256 gracePeriod;
}

struct LoanOffer {
    OfferKind kind;
    bool soft;
    Side side;
    address maker;
    address taker;
    Collateral collateral;
    LoanOfferTerms terms;
    FeeTerms fee;
    uint256 expiration;
    uint256 salt;
}

// ====================================
//            MARKET OFFER
// ====================================

struct MarketOfferTerms {
    IERC20 currency;
    uint256 amount;
    uint256 rebate;
}

struct MarketOffer {
    OfferKind kind;
    bool soft;
    Side side;
    address maker;
    address taker;
    Collateral collateral;
    MarketOfferTerms terms;
    FeeTerms fee;
    uint256 expiration;
    uint256 salt;
}

// ====================================
//              ESCROW
// ====================================

struct Escrow {
    Side side;
    uint256 placeholder;
    uint256 identifier;
    address buyer;
    address seller;
    IERC721 collection;
    IERC20 currency;
    address recipient;
    uint256 amount;
    uint256 fee;
    uint256 rebate;
    uint256 timestamp;
    uint256 lockTime;
}

// ====================================
//              REDEMPTION
// ====================================

struct RedemptionCharge {
  address admin;
  address redeemer;
  Asset[] assets;
  IERC20 currency;
  uint256 amount;
  uint256 expiration;
  uint256 salt;
}

struct Asset {
  IERC721 collection;
  uint256 tokenId;
}

